@notice Sets the governance proxy address
@param _governanceProxy The new governance proxy contract address
@dev Restricted to only the owner. Throws an error if governanceProxy is already set.

@notice Sets the liquidity manager address
@param _liquidityManager The new liquidity manager contract address
@dev Restricted to only the owner. Throws an error if liquidityManager is already set.

@notice Sets the cluster registry address
@param _clusterRegistry The new cluster registry contract address
@dev Restricted to only the owner. Throws an error if clusterRegistry is already set.

@notice Casts votes for a specific proposal on behalf of the GovernanceProxy.
@param governor The Governor contract managing the proposal.
@param proposalId The unique identifier of the proposal.
@param forVotes The total votes in favor of the proposal.
@param againstVotes The total votes against the proposal.
@param abstainVotes The total votes abstaining from the proposal.
@dev This function is restricted to being called by the GovernanceProxy only.
It first calculates the highest cluster of votes needed and saves the voting state.
Then it proceeds to the next stage of the voting process with any remaining votes.

@notice Checks if vote casting has started for a proposal.
@param governorAddress The governor contract address.
@param proposalId The proposal's unique identifier.
@return True if vote casting has started, false otherwise.

@notice Checks if all votes for a specific proposal and governor have been cast.
@param governorAddress Address of the governor contract.
@param proposalId Unique identifier of the proposal.
@return True if all votes are cast; false otherwise.

@notice Continues casting votes for a specific proposal and governor.
@param governorAddress Address of the governor contract.
@param proposalId Unique identifier of the proposal.
@dev This function resumes the voting process started by `castVotes`, iterating over clusters to allocate votes.

@notice Proposes a new governance action.
@param governor The governor contract that manages the proposal.
@param votingToken The token used for voting.
@param targets Array of target addresses for the proposal.
@param values Array of values for the proposal actions.
@param calldatas Array of calldata for the proposal actions.
@param description Description of the proposal.
@return The proposal ID.

@notice Calculate the bit length of an unsigned integer.
@param x The unsigned integer.
@return The bit length.

@notice Determines the maximum value among three unsigned integers.
@param a First unsigned integer.
@param b Second unsigned integer.
@param c Third unsigned integer.
@return The maximum value.
